import axios from "axios"

export const SetLogIn=(data)=>{
  return{
    type:'SET_LOGIN',
    payload:data
  }
}

export const Flogin=({email,password})=> async(dispatch)=>{
    const res= await axios.get('http://localhost:5000/users/login',{email,password})
    dispatch(SetLogIn(res.data))
    console.log

}
